export const FONT_DATA_URL = 'data:font/ttf;base64,';
/**
 * Correct @font-face for Arimo using the embedded TTF data.
 * - Uses font-display: swap for better UX
 * - Declares normal style and weight 400
 * - Covers Latin + Cyrillic unicode ranges
 */

export const ARIMO_FONT_FACE = `@font-face {
  font-family: 'Arimo';
  src: url(${FONT_DATA_URL}) format('truetype');
  font-style: normal;
  font-weight: 400;
  font-display: swap;
  unicode-range: U+0000-00FF, U+0100-024F, U+0300-036F, U+0400-04FF;
}`;

/** Internal one-time guard */
let _arimoInjected = false;

/** Injects the Arimo @font-face into document.head once. */
export function ensureArimoInjected(): void {
  if (typeof document === 'undefined' || _arimoInjected) return;
  const style = document.createElement('style');
  style.setAttribute('data-font', 'arimo');
  style.textContent = ARIMO_FONT_FACE;
  document.head.appendChild(style);
  _arimoInjected = true;
}

/** Convenient stack with Arimo first */
export const ARIMO_FONT_FAMILY =
  "Arimo, system-ui, -apple-system, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, 'Noto Sans', 'Apple Color Emoji', 'Segoe UI Emoji'";
